pragma solidity ^0.4.17;


contract ddddd {
    
    struct User{
        string uaeId;
        string name;
        string phone;
        string gender;
        string dob;
        string addr;
        string email;
        string nomineeName;
        string nomineeContact;
        address eAddress;
        uint date;

    }

    struct Doctor{
        string uaeId;
        string name;
        string phone;
        string gender;
        string dob;
        string addr;
        string email;
        string qualification;
        string major;
        address eAddress;
        uint date;

    }


    
    address public owner;
    address[] public userList;
    address[] public doctorList;

    mapping(address => User) user;
    mapping(address => Doctor) doctor;

    mapping(address=>mapping(address=>bool)) isApproved;
    mapping(address => bool) isUser;
    mapping(address => bool) isDoctor;



    uint256 public userCount = 0;
    uint256 public doctorCount = 0;
    uint256 public permissionCounter = 0;
    address public mohAdress = 0xc50C6297f56b033633C30354A854b074749cd2dC;
    
    function ddddd() public {
        owner = msg.sender;
    }
    
    function userRegistration(string _uaeId, string _name, string _phone, string _gender, string _dob, string _addr, string _email, string _nomineeName, string _nomineeContact) public {
        require(!isUser[msg.sender]);
        var u = user[msg.sender];
        
        u.uaeId = _uaeId;
        u.name = _name;
        u.phone = _phone;
        u.gender = _gender;
        u.dob = _dob;
        u.addr = _addr;
        u.email = _email;
        u.nomineeName = _nomineeName;
        u.nomineeContact = _nomineeContact;
        u.eAddress = msg.sender;
        u.date = block.timestamp;
        
        userList.push(msg.sender);
        isUser[msg.sender] = true;
        isApproved[msg.sender][msg.sender] = true;
        userCount++;
    }
    

      function editUser(address _user, string _uaeId, string _name, string _phone, string _gender, string _dob, string _addr, string _email, string _nomineeName, string _nomineeContact) public {
        require(msg.sender == mohAdress);
        var u = user[_user];
        
        u.uaeId = _uaeId;
        u.name = _name;
        u.phone = _phone;
        u.gender = _gender;
        u.dob = _dob;
        u.addr = _addr;
        u.email = _email;
        u.nomineeName = _nomineeName;
        u.nomineeContact = _nomineeContact;
        u.eAddress = _user;  
    }

    function setDoctor(string _uaeId, string _name, string _phone, string _gender, string _dob, string _qualification, string _major) public {
        require(!isDoctor[msg.sender]);
        var d = doctor[msg.sender];
        
        d.uaeId = _uaeId;
        d.name = _name;
        d.phone = _phone;
        d.gender = _gender;
        d.dob = _dob;
        d.qualification = _qualification;
        d.major = _major;
        d.eAddress = msg.sender;
        d.date = block.timestamp;
        
        doctorList.push(msg.sender);
        isDoctor[msg.sender] = true;
        doctorCount++;
    }

    function editDoctor(address _doctor, string _uaeId, string _name, string _phone, string _gender, string _dob, string _qualification, string _major) public {
        require(msg.sender == mohAdress);
        var d = doctor[_doctor];
        
        d.uaeId = _uaeId;
        d.name = _name;
        d.phone = _phone;
        d.gender = _gender;
        d.dob = _dob;
        d.qualification = _qualification;
        d.major = _major;
        d.eAddress = _doctor;
    }


    function givePermission(address _address) public returns(bool success) {
        isApproved[msg.sender][_address] = true;
        permissionCounter++;
        return true;
    }


    function RevokePermission(address _address) public returns(bool success) {
        isApproved[msg.sender][_address] = false;
        return true;
    }


    function getUsers() public view returns(address[]) {
        return userList;
    }


    function getDoctors() public view returns(address[]) {
        return doctorList;
    }

  
    function searchPatientinformation(address _address) public view returns(string, string, string, string, string, string) {
        require(isApproved[_address][msg.sender]);
        var u = user[_address];
        return (u.uaeId, u.name, u.phone, u.gender, u.dob, u.addr);
        //u.sex, u.email, u.nomineeName, u.nomineeContact
    }

    
    function searchDoctor(address _address) public view returns(string, string, string, string, string, string, string) {
        require(isDoctor[_address]);
        var d = doctor[_address];
        
        return (d.uaeId, d.name, d.phone, d.gender, d.dob, d.qualification, d.major);
    }
    


    function getUserCount() public view returns(uint256) {
        return userCount;
    }

    function getDoctorCount() public view returns(uint256) {
        return doctorCount;
    }

    function getPermissionGrantedCount() public view returns(uint256) {
        return permissionCounter;
    }


}

